import api from './api';


const usersList = {
    registerUser : async (firs_tname, lastname, email, password)=>{
        return api.post("/signup",{firs_tname,last_name, email, password})
    },
    loginUser : async(email, password)=>{
        return api.post("/signin")
    }
}



export default usersList;
